export const themesSettings = {
  activeTheme: 'dark',
  dark: {
    app: 'gainsboro',
    logo: 'white',
    header: 'dark',
    footer: 'dark',
    menu: 'white',
    menu_btn: 'black'
  },
  light: {
    app: 'white',
    logo: 'black',
    header: 'transparent',
    footer: 'light',
    menu: 'transparent',
    menu_btn: 'black'
  }
}
